import {Table , Container, Row, Col, ButtonGroup, Button, Form} from 'react-bootstrap';
import {useDispatch , useSelector} from "react-redux"
import { loadWokers } from '../redux/actions';
const Workers = () => {

    const dispatch = useDispatch();

    useEffect(()=>{
    dispatch(loadWokers());
    }, []);
   
    return (
        <div className='workers'>
            <h1>Workers </h1>

        </div>
    )
}

export default Workers
